import React, { useState, useEffect } from "react";
import Axios from "axios";
const App = () => {
  const [movie, setMovie] = useState([]);
  const api = "https://jsonplaceholder.typicode.com/todos/1";
  console.log(movie);
  useEffect(() => {
    Axios.get(api).then(json => console.log(json));
  }, []);

  return <li>{}</li>;
};

export default App;
